const people = [
    {name: "ahung" , age: 12 ,occupation: "saler"},
    {name: "btoan" , age: 24 ,occupation: "manager" },
    {name: "ckhang" , age: 30 ,occupation: "staff" },
    {name: "dphat" , age: 18 ,occupation: "docter"},
]

function sortByOccupationAndAge(people) {
    return people.sort((a,b) => {
        // Sort by occupation alphabetically
    const occupationComparison = a.occupation.localeCompare(b.occupation);
    if (occupationComparison !== 0) {
      return occupationComparison;
    }
    // Within the same occupation, sort by age ascending
    if (a.age < b.age) {
      return -1;
    } else if (a.age > b.age) {
      return 1;
    }
    return 0;
    });
}


function AreAllTeenager() {
    const sortedPeople = sortByOccupationAndAge(people);
    return (
        <div>
            <h4>----------------------------------------------Exercise 7---------------------</h4>
            <h3>
                Check if all are teenager? Result {people.find(people => (people.age <= 10) || (people.age >= 20))
                 === "undefined" ?  "True": "False"}
            </h3>
            <h4>----------------------------------------------Exercise 8---------------------</h4>
            <h3>Sorted by Occupation and Age (First Print):</h3>
      <ul>
        {sortedPeople.map((person, index) => (
          <li key={index}>
            Name: {person.name}, Age: {person.age}, Occupation: {person.occupation}
          </li>
        ))}
      </ul>
      <h3>Sorted by Occupation and Age (Second Print):</h3>
      <ul>
        {sortedPeople.map((person, index) => (
          <li key={index}>
            Name: {person.name}, Age: {person.age}, Occupation: {person.occupation}
          </li>
        ))}
      </ul>

        </div>
    )
}

export default AreAllTeenager;
